class Solution {
public:
    void bfs(vector<vector<char>>& grid, int r, int c){
        int dx[] = {1, -1, 0, 0};
        int dy[] = {0, 0, 1, -1};
        int row = grid.size();
        int col = grid[0].size();

        for(int i=0; i<4; i++){
            int x = r+dx[i];
            int y = c+dy[i];

            if((x >= 0 && x < row && y >= 0 && y < col) && grid[x][y] == '1'){
                grid[x][y] ='0';
                bfs(grid, x, y);
            }
        }
    }
    int numIslands(vector<vector<char>>& grid) {
        int count = 0;
        for(int r=0; r<grid.size(); r++){
            for(int c=0; c<grid[r].size(); c++){
                if(grid[r][c] == '1'){
                    grid[r][c] = '0';
                    count++;
                    bfs(grid, r, c);
                }
            }
        }

        return count;
    }
};


